import React, { Frag} from "react";

const Post = ({ posts }) => {
    return (
        <div>
        {
            posts.map((post) => {
                const { description, location, price, title } = post
                return (
                    <>
                    <h3>{title}</h3>
                    <p>Description: {description}</p>
                    <p>Price: {price}</p>
                    <p>Location: {location}</p>
                    </>
                )
            })
        }
        </div>
    )
}

export default Post
